(1911, '\\core\\event\\email_failed', 'core', 'failed', 'email', NULL, NULL, 'c', 0, 1, 10, 0, -20, 0, 7, 0, '{\"subject\":\"Mindscape-lb: account confirmation\",\"message\":\"This is a sample message. Your admin can customize it by signing in to\\nMoodle and going to Site Administration \\u300b Language Customization and\\nmodifying the entries related to auth\\/auth_emailadmin.php, especially\\nauth_emailadminconfirmation and auth_emailadminuserconfirmation.\\n\\nIn this message, the admin will find examples of including user data by\\nusing placeholders between { and }. He\'ll find a list of possible fields in\\nthe list generated on his own notification.\\n\\n--\\nHello student 3,\\n\\nWelcome to (My Organization)! Your account has been approved. If you have\\nnot already done so, please tell us how you discovered (My Organization).\\n\\nFor student accounts, please let us know the project you would like to\\nparticipate in and we will create your teacher account. The information for\\ncreating student accounts is at http:\\/\\/www.my.org\\/student-accounts here.\\n\\nThe first name needs to be the students \\\"first name\\\" and \\\"first initial of\\nthe last name.\\\" The students last name will be the school name. Passwords\\nneed to be at least 8 characters long.\\n\\nWe\'re delighted you have joined us and hope to see you and your students\\nparticipating in some of our projects. You are now a member of a rapidly\\ngrowing community of educators and students using (My Organization) to\\nshare projects, work and knowledge. If you ever need help don\'t hesitate to\\nwrite to us at myorg@gmail.com here. We\'ll try to address any questions,\\ncomments or concerns you may have regarding the (My Organization) with\\nGoogle Resources, Services and Tools. Check out our web pages at\\nhttp:\\/\\/www.my.org here\\n\\n* * *\\n\\nWhat is (My Organization)?\\n\\n(My Organization) is an easy-to-use, Internet-based collaborative\\nenvironment that enables educators to develop and manage Web-based\\ncurricular projects, share information, and work together on an\\ninternational level. (My Organization) provides a variety of Google tools\\nand gadgets including integrated messaging, conferencing, and calendars, to\\nsupport collaboration among teachers and students within (My Organization).\\n\\n(My Organization) welcomes your projects and is looking forward to sharing\\na rich variety of projects and activities with your participating students.\\nWhen you login, list of popular categories appears. Click on one of the\\ncategories to browse the projects specified by it. As you browse through\\nthese projects (click on the titles), they may help you generate an idea or\\ntwo for you to use in developing a project of your own in (My Organization)\\nor they may help you to identify projects in which\\nyou may like to collaborate with other teachers and their students.\\n\\n* * *\\n\\nBecause (My Organization) is project driven and run by volunteers, we would\\nlike you to consider creating a project in (My Organization) or\\nvolunteering to help with one. If you decide you would like to create a\\nproject or volunteer to help or support other projects, please email us at\\nmyorg@gmail.com here. (My Organization) leaders and volunteers are here to\\nsupport your needs.\\n\\nRemember, online support for all (My Organization) participants is provided\\nby (My Organization) volunteers. Please take what you learn from us and\\nhelp other teachers learn too! We look forward to working with you and\\nseeing your new projects!\\n\\nThank you,\\n\\nMy Name, Director\\n\\n--\\n(My Organization) Team\\nhttp:\\/\\/www.my.org\\nmyorg@gmail.com\\n123 555 5555\",\"errorinfo\":\"Could not instantiate mail function.\"}', 1711319710, 'web', '0:0:0:0:0:0:0:1', NULL),
